import {
  Grid,
  Paper,
  Typography,
  Button,
  TextField,
  makeStyles,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from '@material-ui/core';

import Navbar from './Navbar';

const useStyles = makeStyles(() => ({
  body: {
    padding: '60px 60px',
    margin: '125px 350px',
  },
  inputBox: {
    width: '300px',
    margin: '-12px',
  },
  submitButton: {
    width: '300px',
    margin: '15px',
    backgroundColor: '#034f84',
    color: 'white',
  },
}));

const Signup = (props) => {
  const classes = useStyles();

  return (
    <Paper elevation={3} className={classes.body}>
      <Navbar />
      <Grid container direction="column" spacing={4} alignItems="center">
        <Grid item>
          <Typography variant="h4" component="h2">
            Signup
          </Typography>
        </Grid>
        <Grid item>
          <TextField
            type="text"
            label="Username"
            className={classes.inputBox}
          />
        </Grid>
        <Grid item>
          <TextField type="email" label="Email" className={classes.inputBox} />
        </Grid>
        <Grid item>
          <TextField
            type="password"
            label="Password"
            className={classes.inputBox}
          />
        </Grid>
        <Grid item>
          <FormControl fullWidth className={classes.inputBox}>
            <InputLabel>Type</InputLabel>
            <Select>
              <MenuItem value="Applicant">Applicant</MenuItem>
              <MenuItem value="Recruitmend">Recruitmend</MenuItem>
            </Select>
          </FormControl>
        </Grid>
        <Grid item>
          <Button variant="contained" className={classes.submitButton}>
            Signup
          </Button>
        </Grid>
      </Grid>
    </Paper>
  );
};

export default Signup;
